import React from "react";

const Icon = () => (
  <>
    <i class="fal fa-sun fa-5x" />
    <input type="checkbox" />
    <i class="fal fa-cloud-sun fa-5x" />
    <input type="checkbox" />
    <i class="fal fa-cloud fa-5x" />
    <input type="checkbox" />
  </>
);

export default Icon;
